import React from 'react';
import {Button} from 'react-bootstrap';
import './App.css';

let App = () => {
  return (
    <>
      <h2>App Component</h2>
      <Button variant='info' classname="mt-3" href='#'>Sign In!</Button>
    </>
  );
}

export default App;
